import React from 'react';
import { connect } from 'react-redux';
import { addTrim } from '../redux/Form';

const Trim = props => {
    return (
        <div className="option-container">
            {props.blackTrims.drilldown.class_list.map(list => list.year_list.map(year => year.make_list.map(make => make.model_list.map(model => model.series_list.map(series => series.style_list.map(style => (
                <option className="option" onClick={props.handleTrimClick} key={style.uvc} value={style.uvc} name="trim">  {style.name} {series.name} </option>
            )))))))}
        </div>
    )
}

export default Trim;
